import React, { useContext, useEffect, useState } from 'react'
import Slider from './Slider';

function InteractiveWindow() {
    const [length, setLength] = useState(6)
    const [indicator, setIndicator] = useState("gray")


  return (
    <div className='custom-shadow flex flex-col justify-between items-center p-5 custom-bg rounded-2xl w-full space-y-6 py-10'>
        <div className="flex justify-between w-full items-center  text-2xl">
            <span className="text-white">Password Length</span>
            <span className='text-yellow-400'>{length}</span>
        </div>

        <Slider setLength={setLength} setIndicator={setIndicator}/>



        <div className="flex justify-between w-full items-center">
          <span className='text-xl text-white'>Strength</span>
          <div className={`rounded-[50%] bg-${indicator}-400 blur-sm w-5 h-5`}></div>
        </div>

        <div className='w-full'>
          <button className='text-yellow-400 bg-pink-600 w-full rounded-xl p-3 shadow-lg shadow-yellow-400  text-xl'>GENERATE PASSWORD</button>
        </div>
    </div>
  )
}

export default InteractiveWindow
